return A.x(a.ot(b.AL("sample_missione_possibile","NARRATORE: Dov'\xe8 la meraviglia nel teatro? Nella sua capacit\xe0 di rovesciare i pregiudizi, di mettere nella condizione di porsi dei quesiti, degli interrogativi a cui la scena pu\xf2 dare risposta o rilanciare ulteriori critiche. Raccontare la nostra umanit\xe0 quale risultato di un insieme di diversit\xe0, ciascuna portatrice di un valore, e di ogni verit\xe0 trovarne le molteplici facce. Cos\xec per Medea che il mito ci ha consegnato quale carnefice, la scena rovescia il pregiudizio e la trasforma in vittima della societ\xe0 perfetta e classica.\nRegista: Buongiorno a tutti. Ci siamo tutti? Siete pronti per il nuovo spettacolo? Lo faremo qui, in questo vecchio teatro, che rester\xe0 in piedi grazie al successo della nostra performance.\nMary: Altrimenti l'area diventerebbe un parcheggio\u2026\nRegista: Vi presento la Signorina Mary, assistente. Se avete domande di qualsiasi tipo rivolgetevi a lei; Lui \xe8 Tom che cura tutto l'aspetto tecnico; poi c'\xe8 Victor, direttore di scena e aiuto regista. Lui vi dar\xe0 i tempi di scena. Infine, Sheila, la coreografa.\nVictor: Ragazzi, sia chiaro: questo spettacolo deve funzionare. Dobbiamo difendere quest'area, che sappiamo essere la pi\xf9 popolare della citt\xe0, la pi\xf9 eterogenea, diversa. Non deve diventare un centro commerciale.\nTom: Il teatro non si tocca, \xe8 fondamentale per una comunit\xe0!\nRegista: Siamo qui per questo! Le parti sono assegnate, riprendiamo da dove eravamo l'altra volta. Sheila fammi vedere la coreografia iniziale.\nSheila: Abbiamo lavorato sul testo della canzone che esprime il disagio e la fatica a trovare un senso.\nRegista: Fammi vedere.\nMary: Scusate se disturbo\u2026 dovreste gentilmente controllare se i dati che ho sono corretti per l'assicurazione. Poi vi verranno fornite tutte le informazioni sui servizi e gli obblighi che dovete osservare. Mi mancano alcune firme..., la Signorina Chiara, Il Signor Simone\u2026\nRegista: Grazie, credo che si possa fare tutto durante la pausa.\nTom: Certo, ora me lo segno!\nRegista: Cominciamo! Scena prima!\nTom: Silenzio per favore, buio in sala.\nVictor: Disponetevi su tre file. Forza. Ok, Tom, luce blu sugli attori.\nRegista: Benissimo, guardate dritto avanti a voi. Sheila dai le indicazioni.\nSheila: Con movimenti lenti spingete mani e braccia, gambe, verso fuori, come se vi districaste da un groviglio di corde.\nRegista: Buttate fuori la fatica, la rabbia, il dolore. Forza ragazzi, convinzione, respirate forte, voglio sentire il respiro\u2026\nVictor: Ok, in proiezione il primo quadro.\nSheila: Ottimo, bene cos\xec. Il primo coro si muove verso destra, mentre il secondo verso sinistra e insieme formano un cerchio di due file intorno a Medea. E piano piano vi abbassate.\nRegista: E dal cerchio esce lei, MEDEA, che si porta in mezzo\u2026 Sheila vuoi occupartene. Perfetto, cos\xec fermi.\nVictor: Secondo quadro in proiezione\u2026 faro su Medea.\nCORO 1: Il buio non \xe8 una novit\xe0 per me. Nasconditi, dicevano. Perch\xe9 non vogliamo i tuoi pezzi rotti.\nCORO 2: Ho imparato a vergognarmi di tutte le mie cicatrici. Scappa via, dicevano. Nessuno ti amer\xe0 per ci\xf2 che sei.\nMedea: Io sono l'altra. Io a Corinto. La perfetta citt\xe0 di Corinto, dove giungo straniera a bordo dell'Argo dalla mia Colchide.\nCORO 1: La Colchide: la terra al confine del mondo, ai piedi del Caucaso, il cui profilo montuoso \xe8 inscritto dentro ciascuno di noi, Colchi esuli.\nCORO 2: Montagne e boschi leggiamo nei nostri occhi di esuli, quando ci incontriamo per cantare le nostre canzoni, raccontare le storie dei nostri dei e della nostra stirpe.\nCORO 1: Sei tu, Medea\u2026 principessa della Colchide e figlia del re Eete.\nCORO 2: Forse era meglio, per te, se non aiutavi Giasone a conquistare il vello d'oro.\nCORO 1: Forse era meglio per te non incontrare Giasone.\nCORO 2: Tu, Medea, non abiteresti adesso, in questa terra corinzia, esule e incompresa.\nMedea: Non avrei dovuto aiutare Giasone a tirare gi\xf9 dalla quercia del dio della guerra quella pelliccia di ariete. Il vello d'oro! L'oro che Corinto brama, perch\xe9 qui il valore di un cittadino si misura dalla quantit\xe0 di oro che possiede. Ho capito presto che possedere l'oro cambia il destino di un uomo e di una citt\xe0.\nCORO 1: Non avresti dovuto, donna, usare la tua arte e la tua conoscenza per ammansire il grosso serpente che proteggeva il vello.\nCORO 2: Fu grazie a te che Giasone pot\xe9 uccidere quel mostro e rubare il vello.\nMedea: E ora Giasone, mio marito e padre dei miei figli, mi rinnega per giacere con Glauce, la figlia del re Creonte. Guardate come soffro\u2026\nVictor: Terzo quadro; la sofferenza dell'esclusione.\nSheila: I componenti delle due file in cerchio si alzano, danno le spalle a Medea, intrecciano le braccia l'uno all'altro e ruotano un paio di volte.\nRegista: Stop! Qui \xe8 il momento di sofferenza atroce, dammi tensione, l'aria deve risultare spessa. Senti l'orgoglio ferito, senti l'offesa. Sheila cosa hai pensato qui?\nSheila: In sequenza sollevano il braccio verso Medea. E lei finge di ricevere i colpi.\nMedea: Guardate come soffro! Avevo legato a me con giuramenti indissolubili il mio sposo, io straniera in una terra straniera, io, principessa della Colchide, che il re Creonte ha chiamata \"barbara\"\u2026\nMedea: S\xec, ok, ma scusa: questo personaggio \xe8 troppo complesso. Fammi capire! In fondo di Medea si sa che ha ucciso i figli per vendicarsi del tradimento del marito e ne ha ucciso anche la nuova moglie. Pi\xf9 che una vittima mi sembra un'assassina!\nRegista: \xc8 pi\xf9 complesso di cos\xec. \xc8 vittima di un contesto sociale ostile, dove regna il pregiudizio verso lo straniero, verso l'altro.\nGiasone: Questo \xe8 un dramma antico, lontano dalla sensibilit\xe0 moderna. Io stesso, Giasone, sono un eroe solo perch\xe9 ho ucciso un serpente?! Andiamo\u2026 gli eroi combattono i nemici della patria... mica i serpentelli!\nRegista: Ok, ora vi spiego. Sedete un momento tutti.\nVictor: Luce sul palco, per favore\u2026\nTom: Luce sul palco.\nLissa: Sono d'accordo con loro. Io che sono la nutrice dei figli di Medea, trovo che questa tragedia non sia che un clich\xe9, amore contrastato, assassinio cruento, vendetta. Mi sembra un trillerone per Netflix, anche se manca un bell'incesto. E anch'io sono, come sempre nelle tragedie, quel personaggio che \xe8 saggio, equilibrato, preoccupato\u2026 perch\xe9 \xe8 la nutrice. Ma perch\xe9 Lissa non fa un gesto inconsulto, fuori dalle righe, tipo non scappa con Giasone, e magari prende una nave e fonda una citt\xe0? Lissandra! Oggi conosciuta come Alessandria!\nGiasone: S\xec giusto! Alla fine, potrebbe essere interessante rivendicare la forza del personaggio, la sua autonomia dal testo, come dice Pirandello, no?! E anche Giasone potrebbe alla fine fregarsene di tutti, Medea, i suoi figli, la novella sposa, e andare alle isole Frisi con la maga Circe.\nLissa: Vabb\xe8 adesso, volevo solo essere una nuova protagonista, mica rivoluzionare il mito\u2026\nCreonte: Io invece non amo l'autorit\xe0. La figura del re despota non la trovo attuale.\nGiasone: Ma cosa stai dicendo? Il despota non \xe8 attuale? Lo trovi in qualunque forma estrema di potere.\nRegista: \xc8 colui che va oltre l'hybris, che si pone al di sopra delle leggi degli dei.\nVictor: Attenzione, la nostra idea \xe8 che la tragedia vada letta a pi\xf9 livelli. Qui il teatro greco racconta una storia per definire quali siano i limiti da non superare per conservare l'equilibrio di una societ\xe0.\nRegista: Il teatro \xe8 un'alta forma di educazione alla cittadinanza, e lo era ancor pi\xf9 per i Greci dell'epoca classica.\nLissa: Ma dalla vita politica non erano escluse le donne e gli stranieri?\nRegista: Gi\xe0! La societ\xe0 greca non \xe8 perfetta. E il teatro la rappresenta. Medea \xe8 donna e straniera\u2026 la storia \xe8 attuale in realt\xe0.\nLissa: L'emancipazione femminile \xe8 ancora in atto almeno nei termini della parit\xe0 fra i sessi. Tutti sanno che la societ\xe0 \xe8 ancora maschilista!\nVictor: E poi la diversit\xe0 sia sociale, per abitudini di vita, sia come origine di provenienza, sia come cultura sia come lingua, \xe8 storia di oggi\u2026 No?!\nRegista: Esattamente, vedete\u2026 il dramma ci offre diversi spunti di riflessione.\nVictor: Medea \xe8 la vittima del pregiudizio. \xc8 spinta ad agire da una societ\xe0 che la costringe ad essere ci\xf2 che non \xe8.\nCreonte: Lei \xe8 diversa: diversa perch\xe9 \xe8 donna e straniera.\nGiasone: Ma Giasone vuole salvarla dalla corte del Re, perch\xe9 il suo modo di essere la rendono pericolosa e per la societ\xe0 \xe8 una strega.\nRegista: Giasone finge di agire a vantaggio di Medea, ma quello che vuole \xe8 il vello d'oro, cio\xe8 il potere\u2026\nMedea: S\xec, insomma, la sua condotta fuori dalle righe, autonoma, addirittura arrogante fa paura al Re, perch\xe9 esprime un pensiero libero.\nCreonte: E il re la teme perch\xe9 sa che il suo potere si fonda sulla corruzione.\nGiasone: Eh per\xf2 ci sono in giro voci secondo cui \xe8 lei ad aver ucciso il fratello in patria. Anche il popolo la vede come colei che esercita la magia nera...\nMedea: Io non ho ucciso il fratello\u2026 \xe8 solo un altro modo per diffamarmi.\nVictor: S\xec, la diffamazione \xe8 pi\xf9 crudele su chi vive una condizione di esule.\nRegista: Il pregiudizio che affiora dalla tragedia di Medea \xe8 simile a chi vive, come i Colchi, in una citt\xe0 straniera.\nLissa: E si trova in bilico se provare a integrarsi o conservare le proprie radici e i propri costumi.\nMedea: Vivo una doppia tragedia: esclusa dal mondo come straniera e destinata a non trovare pace, perch\xe9 tradita dal mio sposo.\nMary: Datemi due minuti, ragazzi, ho qui un elenco-men\xf9 per il pranzo. Basta che mettiate delle crocette su quale panino-bevanda volete. Passatevelo per favore.\nSara: Scusa Mary, ma dove mettiamo le nostre borse, finch\xe9 siamo di prova?\nMary: Ci sono degli armadietti nei camerini, ma non ci sono a disposizione lucchetti. Diciamo che non vi conviene lasciare soldi o cellulare.\nSara: E quindi, che significa?\nMary: Significa che ti conviene tenere tutto a vista!\nPietro: Significa che chiunque pu\xf2 entrare, prendere\u2026 significa che qui non \xe8 sicuro?\nSara: Fantastico, e la mia roba??\nMary: Tesoro mio caro, non c'\xe8 un posto sicuro, da quel che so, al mondo!\nJordan: Wow, alla faccia dei pregiudizi! Fantastico! Non stiamo facendo 'sto spettacolo per raccontare qualcosa di diverso\u2026 un po' di fiducia no?!\nSara: Fiducia? Io voglio un lucchetto!\nMary: Sono vent'anni che lavoro per questo teatro e ne ho visto di umanit\xe0. E credimi che, se uno vede un cellulare o soldi incustoditi, si sente autorizzato a prenderseli!\nSara: Allora che ci stiamo a fare qui?\nJordan: Ma s\xec fa tutto schifo! Andiamo... quando Victor mi ha conosciuto in un locale e mi ha chiesto di venire qui e fare questo spettacolo, mi sono detto: tutto \xe8 meglio che stare sulla strada e l\xec \xe8 dura davvero e non voglio tornarci! E Soldi, soldi... sono importanti, ma c'\xe8 anche dell'altro nella vita!\nMary: Vogliamo procedere con i dati? Dimmi nome e cognome.\nGiovanni: Ayeye.\nMary: Cosa?\nGiovanni: Agliele!\nMary: Ti chiami Agliele?\nGiovanni: Agliele.\nMary: Come si scrive 'sto Ayeye?\nGiovanni: Ayeye si scrive, A a i lunga, e 2 volte yeye poi y lunga.\nMary: Dimmi il cognome... Con un nome cos\xec chiss\xe0 il cognome.\nGiovanni: Ayeye Brazoff.\nMary: Ti chiami Ayeye Brazoff? Cio\xe8, la mamma marocchina e il pap\xe0 serbo-croato, eh? Non dire stupidaggini.\nGiovanni: Si vede che si sono conosciuti\u2026\nMary: Fammi vedere un documento di identit\xe0.\nGiovanni: M'hanno fregato i documenti.\nMary: Dai, pirla! Andiamo di l\xe0 e vediamo come risolvere il problema.\nTom: Scusate ragazzi, ma non vedo la scatola dei microfoni, era una cassetta grigia. Il tempo di andare a prendermi un'acqua ed \xe8 sparita\u2026\nPietro: Veramente, noi eravamo qui che cantavamo, non l'abbiamo vista\u2026\nDavid: Io nemmeno\u2026\nTom: Una valigetta grigia, \xe8 davvero importante ragazzi, ci sono almeno settemila euro in microfoni.\nDavid: Beh allora se valeva cos\xec tanto\u2026 \xe8 facile che qualcuno qui se la sia presa.\nJordan: Scusa, cosa vorresti dire? Che l'ho presa io? Solo perch\xe9 ho detto che vengo dalla strada, non vuol dire che sono un delinquente!\nDavid: Beh, non sei l'unico morto di fame qui dentro\u2026\nJordan: Scusa, cos'hai detto?\nDavid: Dico solo che qui ce n'\xe8 di gente strana, chiunque avrebbe potuto approfittare.\nSara: Basta David, o dovrei dire che tu, come qualche altro, vivete occupando una casa abusiva e che vivete sulle spalle di noi che paghiamo le tasse!\nDavid: Non sono affari tuoi dove vivo!\nTom: Ragazzi, non litigate e aiutatemi a cercare 'sta cassetta!\nJordan: Nessuno se ne vada!\nPietro: Lascialo stare \xe8 un caso umano, credo che abbia qualche disturbo...\nGiacomo: Io\u2026 veramente, mi spiace, stavo solo cercando qua dietro, non... non sono stato io, ero qui con voi\u2026 scusate, io\u2026 io\u2026\nJordan: E piantala di frignare!!!!\nKate: Lascialo stare Jordan, non vedi che lo stai terrorizzando?\nGiacomo: No, no\u2026 \xe8 che io non sarei capace di rubare nulla, scusate io, ecco, comunque non posso portare pesi... ecco, ho qualche difficolt\xe0, scusate\u2026\nKate: Tranquillo, Giacomo, non c'\xe8 bisogno che ti mortifichi per questi bulletti.\nPietro: E basta, l'abbiamo capito che sei uno sfigato!\nKate: Pietro, accidenti, smettila\u2026\nPietro: Ah gi\xe0 abbiamo difronte Kate, la crocerossina!\nKate: Sei decisamente uno sfigato! Pietro!\nMary: Scusa, per caso ce l'hai anche con gli ebrei? Perch\xe9 io sono ebrea!\nTom: Mary, che fai, ti ci metti anche tu?\nPietro: Adesso non ne facciamo 'na questione! Era una battuta!\nJordan: S\xec, ne facciamo 'na questione invece! Perch\xe9 io sono albanese ed \xe8 risaputo che viviamo di espedienti, no? E Jon \xe8 rumeno e si sa che vive di furtarelli, no? E di Amad, che dici\u2026 magari \xe8 un terrorista! E Alex, che \xe8 pieno di tatuaggi e piercing, spaccia droga e microfoni, no?! E tu che sei italiano, non \xe8 che sei un mafioso?\nTom: Basta cos\xec! Ragazzi, basta cos\xec! Sono sicuro che salter\xe0 fuori! Smettetela!\nSara: Ha ragione Tom. Ragazzi finiamola!\nRegista: Fantastico, ragazzi, ottimo lavoro! Dobbiamo far capire al nostro pubblico che non ci si misura con il pregiudizio, ma con la conoscenza, con la cultura che \xe8 anche sensibilit\xe0, buon senso, cuore\u2026 Siamo giunti alla conclusione che Medea non \xe8 il volto selvaggio dei barbari contro il mondo perfetto dei Greci, ma \xe8 un cuore in tumulto.\nRegista: Che succede? Vi lascio un momento e cambia il clima? Che \xe8 successo?\nTom: Niente, John, tranquillo\u2026 sono solo un po' stanchi!\nMedea: Me ne andr\xf2 via, in esilio, diranno i pi\xf9 alti poeti che ho ucciso anche i miei figli. Sia come sia. Non ho patria, non ho casa, non ho sposo, non ho figli. Non ho rimedio per le mie sventure.\nCORO 1: Ormai si \xe8 dissolta ogni speranza: Medea, ti diranno colpevole della morte dei tuoi figli.\nCORO 2: Ti diranno colpevole della morte della sposa di Giasone. Diranno che da te \xe8 stata avvelenata!\nMedea: Ora odiatemi pure per quello che i poeti hanno detto che ho fatto, l'odio che provate \xe8 fatto del mio dolore e della mia paura! Forse dovreste provare pena per me.\nRegista: Luce sul palco! E questa? Che roba \xe8?\nTom: Quella l\xec \xe8 una valigia di microfoni data per persa e miracolosamente ricomparsa!\nRegista: Che significa?\nTom: Significa che questo \xe8 un posto sicuro!\nSara: Dove le cose si trovano e non vanno mai perse!\nKate: Dove non sono necessari lucchetti!\nDavid: Perch\xe9 qui c'\xe8 profondo rispetto verso le cose di tutti e verso ognuno di noi!\nJordan: Rispetto verso le cose di questo teatro e verso chi ha deciso di fare teatro!\nGiacomo: Rispetto per tutti noi che tentiamo una strada diversa di socializzazione!\nPietro: Senza pregiudizi!\nMary: Ognuno con le sue mansioni e con i suoi particolarissimi talenti!\nRegista: Medea ce lo ha insegnato, no?\nMedea: Gi\xe0, Medea ce lo ha insegnato!\n","Missione Possibile")),$async$YB)
